interface DefaultData {
  list_id: number;
  list_title: string;
  card_contents: CardContents[];
}

interface CardContents {
  id: number;
  username?: string;
  subject: string;
  content?: string;
  order_number?: number;
}

const DEFAULT_DATA: DefaultData[] = [
  {
    list_id: 1,
    list_title: "To Do",
    card_contents: [],
  },
];

export default DEFAULT_DATA;
